          <p>Hi,</p>
          <p>My name is Amna</p>
          <p>I am a Software development Student.</p>
        </h1>
        <Link to="about">
          <button>About</button>
        </Link>
      </div>
      <div className="me">
      <img
              src="https://raw.githubusercontent.com/amnasyeda/react-portfolio/main/public/css/bio.png"
              alt="bio"
            />
      </div>
    </div>
  );
};










